var GreenSquares = canvas.selectAll("rect")
    .data(json)
    .enter()
    .append("rect")
    .attr("x", function (d,i) {return Getcoords(d, center_x(d.team_num), center_y(d.team_num, d.conference_num))[0]; })
    .attr("y", function (d,i) {return Getcoords(d, center_x(d.team_num), center_y(d.team_num, d.conference_num))[1]; })
    .attr("width", function (d,i) {return Getcoords(d, center_x(d.team_num), center_y(d.team_num, d.conference_num))[2]; })
    .attr("height", function (d,i) {return Getcoords(d, center_x(d.team_num), center_y(d.team_num, d.conference_num))[2]; })
    .attr('fill', function(d,i) {return Getfill(d.player_num); })
    .attr('stroke-width', '2')
    .attr('stroke', 'none')
    .on("mouseover", mouseover)
    .on("mousemove", mousemove)
    .on("mouseleave", mouseleave);



